import React,{useState} from 'react';
// import { Button } from 'react-scroll';
import Video from '../../Videos/TeamVB.mp4';
import {Button} from '../ButtonElement';
import{
    TemaContainer,
    VdoBG,
    TeamBG,
    TeamContent,
    TeamH1,
    TeamP,
    ButtonWrper,
    ArrowForward,
    ArrowRight
} from './TeamElements'


const Team = () => {

    const [hover, setHover] = useState(false)

    const onHover = () => {
        setHover(!hover)
    }

    return (
        <>
            <TemaContainer>
                <TeamBG>
                    <VdoBG autoPlay loop muted src={Video} type='video/mp4'/>
                </TeamBG>
                <TeamContent>
                    <TeamH1>Team Visible</TeamH1>
                    <TeamP>
                        AutoPlay slider
                    </TeamP>
                    <ButtonWrper>
                        <Button 
                            to="signin" 
                            onMouseEnter={onHover} 
                            onMouseLeave={onHover} 
                            primary='true'  
                            dark='true'>
                            Sign In {hover ? <ArrowForward/> : <ArrowRight/>}
                        </Button>
                    </ButtonWrper>
                </TeamContent>
            </TemaContainer>  
        </>
    )
}

export default Team
